const Container = styled.div``;

const Title = styled.h1``;

const FilterContainer = styled.div`
    display:flex;
    justify-content
`;

const Filter = styled.div``;


const ProductList = () => {
  return (
    <Container>
        <Navbar/>
        <Announcement/>

        <Title>Dresses</Title>

        <FilterContainer>
            <Filter>filter1</Filter>
            <Filter>filter2</Filter>
